import React from "react";
import "./Navigation.css";
import { motion } from "framer-motion";

const CartNav = () => {
  return (
    <motion.div drag layout id="nav-mobile">
      <div class="page-inner">
        <div class="page-middle">
          <a href="/">
            <div class="nav2-left-top"></div>
          </a>
        </div>
      </div>
      <div id="nav-mobile-bottom">
        <div id="nav2-left-bottom-inner">
          <div class="nav2-left-bottom"></div>
          <div class="nav2-left-bottom"></div>
          <div class="nav2-left-bottom"></div>
          <div class="nav2-left-bottom"></div>
        </div>
      </div>
    </motion.div>
  );
};

export default CartNav;
